import React, { useState } from 'react';
import './Calender.css'; // Adjust the path accordingly

const MyCalendar = ({ events }) => {
  const [selectedDate, setSelectedDate] = useState(null);
  const today = new Date();

  const handleDateClick = (date) => {
    setSelectedDate(date);
  };

  const generateCalendar = () => {
    const daysOfWeek = ['S', 'M', 'T', 'W', 'T', 'F', 'S'];
    const daysInMonth = new Date(today.getFullYear(), today.getMonth() + 1, 0).getDate();
    const firstDayOfMonth = new Date(today.getFullYear(), today.getMonth(), 1).getDay();

    let calendarDays = [];
    for (let i = 0; i < firstDayOfMonth; i++) {
      calendarDays.push(<div key={`empty-${i}`} className="empty"></div>); // Empty cells before the first day
    }

    for (let day = 1; day <= daysInMonth; day++) {
      const isSelected = selectedDate === day;
      calendarDays.push(
        <div
          key={day}
          className={`day ${isSelected ? 'selected' : ''}`}
          onClick={() => handleDateClick(day)}
        >
          {day}
        </div>
      );
    }

    return calendarDays;
  };

  return (
    <div className="calendar-container">
      <div className="calendar-header">
        <button>{'<'}</button> {/* Add functionality to change month */}
        <span>{today.toLocaleString('default', { month: 'long' })} {today.getFullYear()}</span>
        <button>{'>'}</button> {/* Add functionality to change month */}
      </div>
      <div className="calendar-grid">
        {['S', 'M', 'T', 'W', 'T', 'F', 'S'].map((day, index) => (
          <div key={index}>{day}</div>
        ))}
        {generateCalendar()}
      </div>
    </div>
  );
};

export default MyCalendar;


